  true,\n\t\"url\": null,\n\t\"notes\": \"The NASA Earth Exchange (NEX) Global Daily
  Downscaled Projections (NEX-GDDP) dataset is comprised of downscaled climate scenarios
  that are derived from the General Circulation Model (GCM) runs conducted under the
  Coupled Model Intercomparison Project Phase 5 (CMIP5) [Taylor et al. 2012] and across
  the two of the four greenhouse gas emissions scenarios known as Representative Concentration
  Pathways (RCPs) [Meinshausen et al. 2011] developed for the Fifth Assessment Report
  of the Intergovernmental Panel on Climate Change (IPCC AR5). The dataset is an ensemble
  of projections from 21 different models and two RCPs (RCP 4.5 and RCP 8.5), and
  provides daily estimates of maximum and minimum temperatures and precipitation using
  a daily Bias-Correction - Spatial Disaggregation (BCSD) method (Thrasher, et al.,
  2012). The data spans the entire globe with a 0.25 degree (~25-kilometer) spatial
  resolution for the periods from 1950 through 2005 (Historical) and from 2006 to
  2100 (Climate Projections).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
